import React, { useState } from "react";
import { Route, Routes } from "react-router-dom";
import Header from "./components/header/header";
import Footer from "./components/footer/footer";
import Components from "./views/components/components";
import SurveyGender from "./components/SurveyGender";
import SurveyBirthYear from "./components/SurveyBirthYear";
import SurveyInterest from "./components/SurveyInterest";
import SurveyResult from "./components/SurveyResult";
import Main from "./components/Main";
import Mypage from "./components/Mypage";
import WishList from "./components/WishList";
import Preview from "./components/Preview";

function App() {
  const [survey, setSurvey] = useState({
    gender: "",
    age: 0,
    interest: "",
  });

  return (
    <div>
      <Header />
      <Routes>
        <Route path="/" element={<Preview />} />
        <Route
          path="/survey"
          element={<SurveyGender />}
          setSurvey={setSurvey}
        />
        <Route
          path="/survey/age"
          element={<SurveyBirthYear />}
          setSurvey={setSurvey}
        />
        <Route
          path="/survey/item"
          element={<SurveyInterest />}
          setSurvey={setSurvey}
        />
        <Route
          path="/survey/result"
          element={<SurveyResult />}
          survey={survey}
        />
        <Route path="/main" element={<Main />} />
        <Route path="/mypage" element={<Mypage />} />
        <Route path="/wishlist" element={<WishList />} />
      </Routes>
      <Footer />
    </div>
  );
}

export default App;
